import React from 'react'

const Team = () => {
    const companyInfo = '〒606-8393 Kyoto, Sakyo Ward, Higashitakeyacho, 50'

    return ( 
        <section>
            <h1>Contact</h1>
            <div>
                <h2>よくある質問</h2>

            </div>
            <form>
                <input type="text"/>

            </form>
            <div>

                <strong><a href="https://goo.gl/maps/N1hncwgvdcSZM7tp9">{(companyInfo)}</a></strong>
            </div>
        </section> 
    );
}
export default Team;
